import React from "react";

import Button from "../../UI/Button";

const MealsIteams = (props) => {
  return (
    <li>
      <div>
        <h3>{props.name}</h3>
        <div>{props.description}</div>
        <div>{props.price}</div>
      </div>
      <div>
        <label htmlFor="amount">Amount</label>
        <input id="amount" value={1}></input>
        <Button>+Add</Button>
      </div>
    </li>
  );
};

export default MealsIteams;
